import ExerciseList from './ExerciseList';

function App() {
  return (
    <Router>
      <div className='navbar'>
    <div className="container">
    <h1 className="logo">ExcerTra</h1>
    <nav>
      <ul>
        <li><a href="">Home</a></li>
        <li><a href="">The Team</a></li>
        <li><a href="">Contact</a></li>
      </ul>
    </nav>
  </div>
  </div>
    </Router>
  );
}

export default App;
